import React, {useState} from 'react'

import Login from '../components/Login'

const AuthenticationPage = () => {

  let [authentication, setAuthentication] = useState('login')

  function changeAuthenticationType(authType) {
    setAuthentication(authType)
  }

  return (
    <div className='w-100 d-flex justify-content-center align-items-center'>
      {authentication === 'signup' ? <p>Sign Up Page <button onClick={(e) => changeAuthenticationType('login')}>Hha</button></p> : <Login changeToSignUp={changeAuthenticationType} />}
    </div>
  )
}

export default AuthenticationPage
